import { NgModule } from "@angular/core";
import { CommonModule } from "@angular/common";

import { Component } from "@angular/core";

@Component({
  selector: "my-component, MyComponent",
  template: `
    <header class="main-container">
      <div class="header-wrapper">
        <div class="header-column">
          <span class="header-span">
            <div class="header-title">Plant trees for free.</div>
            <div class="header-subtitle">Make the planet better.</div>
          </span>
        </div>
        <div class="header-column">
          <span class="header-span">
            <div class="header-login">Sign in</div>
            <div class="input-label">Username</div>
            <div class="input-wrapper">
              <input class="input" type="text" aria-label="Username" />
            </div>
            <div class="input-label">PASSWORD</div>
            <div class="input-wrapper">
              <input class="input" type="password" aria-label="Password" />
            </div>
            <button class="login-button" type="submit">Login</button>
            <div class="header-register">
              <div class="header-register-text">Otherwise, please</div>
              <a class="header-register-link" href="/register">Register here</a>
            </div>
          </span>
        </div>
      </div>
    </header>
  `,
  styles: [
    `
      .main-container {
        justify-content: center;
        background-color: var(--whitePure, #081c15);
        display: flex;
        max-width: 955px;
        flex-direction: column;
        padding: 50px 16px;
      }

      .header-wrapper {
        margin: 138px 0 75px;
      }

      @media (max-width: 991px) {
        .header-wrapper {
          max-width: 100%;
          margin: 40px 0;
        }
      }

      .header-column {
        gap: 20px;
        display: flex;
      }

      @media (max-width: 991px) {
        .header-column {
          flex-direction: column;
          align-items: stretch;
          gap: 0px;
        }
      }

      .header-span {
        align-self: stretch;
        display: flex;
        flex-direction: column;
        margin: auto 0;
      }

      @media (max-width: 991px) {
        .header-span {
          max-width: 100%;
          margin-top: 40px;
        }
      }

      .header-title {
        color: var(--greenDark, #e8f5f1);
        letter-spacing: 0.25px;
        font: 400 34px/118% Roboto, sans-serif;
      }

      @media (max-width: 991px) {
        .header-title {
          max-width: 100%;
        }
      }

      .header-subtitle {
        color: var(--greenDark, #e8f5f1);
        letter-spacing: 0.25px;
        margin-top: 8px;
        font: 400 34px/118% Roboto, sans-serif;
      }

      @media (max-width: 991px) {
        .header-subtitle {
          max-width: 100%;
        }
      }

      .header-login {
        color: var(--greenDark, #e8f5f1);
        white-space: nowrap;
        font: 400 23px/139% Roboto, sans-serif;
      }

      @media (max-width: 991px) {
        .header-login {
          white-space: initial;
        }
      }

      .input-label {
        color: var(--greenDark, #e8f5f1);
        letter-spacing: 2px;
        text-transform: uppercase;
        margin-top: 32px;
        font: 400 12px/32px Roboto, sans-serif;
      }

      .input-wrapper {
        border-radius: var(--8, 8px);
        background-color: var(--greenLight, #d0ffd7);
        display: flex;
        margin-top: 4px;
        flex-direction: column;
        justify-content: center;
      }

      .input {
        justify-content: center;
        align-items: center;
        border-radius: var(--4, 4px);
        border: 1px solid var(--greenLight, #d0ffd7);
        background-color: var(--greenLight, #d0ffd7);
        display: flex;
        height: 40px;
        flex-direction: column;
      }

      .input-label {
        color: var(--greenDark, #e8f5f1);
        letter-spacing: 2px;
        text-transform: uppercase;
        margin-top: 4px;
        font: 400 12px/32px Roboto, sans-serif;
      }

      .input-wrapper {
        border-radius: var(--8, 8px);
        background-color: var(--greenLight, #d0ffd7);
        display: flex;
        margin-top: 4px;
        flex-direction: column;
        justify-content: center;
      }

      .input {
        justify-content: center;
        align-items: center;
        border-radius: var(--4, 4px);
        border: 1px solid var(--greenLight, #d0ffd7);
        background-color: var(--greenLight, #d0ffd7);
        display: flex;
        height: 40px;
        flex-direction: column;
      }

      .login-button {
        color: var(--cardsWhite, #081c15);
        white-space: nowrap;
        justify-content: center;
        align-items: center;
        border-radius: 6px;
        box-shadow: 0px 4px 61px 0px rgba(45, 106, 79, 0.4);
        background-color: var(--cardsMainColor, #f4fbf9);
        margin-top: 32px;
        padding: 11px 60px;
        font: 600 18px Poppins, sans-serif;
      }

      @media (max-width: 991px) {
        .login-button {
          white-space: initial;
          padding: 0 20px;
        }
      }

      .header-register {
        align-items: center;
        display: flex;
        margin-top: 32px;
        justify-content: space-between;
        gap: 6px;
      }

      .header-register-text {
        color: var(--greenDark, #e8f5f1);
        margin: auto 0;
        font: 400 14px Poppins, sans-serif;
      }

      .header-register-link {
        color: var(--greenDark, #e8f5f1);
        font: 600 16px Poppins, sans-serif;
      }
    `,
  ],
})
export class MyComponent {}
